        <Footer>
            <InformacoesFooter>
                <Circulos>
                    <Div1></Div1>
                    <Div2></Div2>
                    <Div3></Div3>
                </Circulos>
                <NavFooter>
                    <Ul>
                        <Link to="">Sobre</Link>
                        <Link to="#">Informação</Link>
                        <Link>Contato</Link>
                    </Ul>
                </NavFooter>
            </InformacoesFooter>
            <P>Copyright © All rights reserved</P>
        </Footer>
    )
}

const Footer = styled.footer`
    background-color: black;
    color: white;
    width: 100%;
    height: 152px;
`;

const InformacoesFooter = styled.section`
