    background: #C4C4C4;
    width: 27px;
    height: 27px;
    border-radius: 50%;
`;

const Div2 = styled.div`
    background: #C4C4C4;
    width: 27px;
    height: 27px;
    border-radius: 50%;
`;

const Div3 = styled.div`
    background: #C4C4C4;
    width: 27px;
    height: 27px;
    border-radius: 50%;
`;

const Ul = styled.ul`
    display: flex;
    justify-content: space-around;
    align-items: center;
    list-style: none;
    margin-right: 50px;
    height: 50px;
    width: 300px;
    font-family: Biryani, sans-serif;

`;

const NavFooter = styled.nav`
    display: flex;
`;

const Li = styled(Link)`
    text-decoration: none;
